script: |
  super -f text -I q10746.spq | sort > q10746.out

inputs:
  - name: q10746.spq
    data: |
      SELECT + col2 / 86 - + - col1 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT col1 * - ( + col2 ) + - + 82 * col0 + col2 + - col1 IS NULL;
  - name: tab2

outputs:
  - name: q10746.out
    data: |
      51
      67
      77
